import React from 'react'
import './Widgets.css'

function Widgets() {
    return (
        <div className='widgets'>
            <iframe
             width="340" 
             height="100%" 
             src="  https://www.google.com/search?q=developer+photo&sxsrf=AOaemvJWMNNkA53aLr-azaQBrcmV2k62pA:1635587691465&tbm=isch&source=iu&ictx=1&fir=Cw4Io3TZW4ct8M%252CktnG3jDdKd5MBM%252C_%253BNB74EdBtno2D7M%252CktnG3jDdKd5MBM%252C_%253BtVcJNDc6NP6-pM%252CktnG3jDdKd5MBM%252C_%253BDZGfc1OMU66TwM%252Cy__Gb749qbobFM%252C_%253BURoY6zHgVSUsNM%252CktnG3jDdKd5MBM%252C_%253Bf3rbHiiyawLm1M%252C7djpaBjcLz8yUM%252C_%253BYC5JUULGW5kxIM%252CktnG3jDdKd5MBM%252C_%253Bvrh8m3N2eCXIcM%252CJx9HqMmHrS8FHM%252C_%253BBZng0ZTaNRRFhM%252CGeGvtCUE9ZhnyM%252C_%253BC-vssKNqkEbVdM%252CX3TQD0uSZIKhaM%252C_%253BK4dn0KRdcxOaGM%252CEaQGJ1QqNEJ26M%252C_%253BX-5YmmW-VUQ2jM%252CX3TQD0uSZIKhaM%252C_&vet=1&usg=AI4_-kSYeJQ7MXp8SRaoJbezgGw3xWm3Uw&sa=X&sqi=2&ved=2ahUKEwiJyeT67vHzAhW0p5UCHc-RBGkQ9QF6BAgKEAE#imgrc=NB74EdBtno2D7M" 
            /*  title="YouTube video player" */ 
             frameborder="0" 
             allowTransparency='true'
             style={{border:'none', overflow:'hidden'}}
             allow='encrypted-media'
             scrollig='no'
             allowfullscreen></iframe>

             
        </div>
    )
}

export default Widgets
